import {Container} from "react-bootstrap";
import './App.css';


class Header extends Component {

    render(){
        return (
            <Container>
                <h1 className="Head">Mikhail Gorbachev</h1>
                <p className="Tagline"></p>
            </Container>
        )
    }

} export default Header
